import Vue from 'vue';
import Router from 'vue-router';
import Index from "./views/Index.vue";
import Details from "./views/Details.vue";
import NotFound from "./views/NotFound.vue";
Vue.use(Router);
export default new Router({
  routes: [{
    path: "/",
    component: Index
  }, {
    path: "/index",
    component: Index
  }, {
    path: "/details/:lid",
    component: Details,
    props: true
  }, {
    path: "*",
    component: NotFound
  }]
});
